css:
@-moz-document url-prefix("https://apk.tw/") {
body,  select {
    background: #333333;
    color: #707070;
}
dl,div{
    background: none;
}
.itemList dl {
    background: #000;
}
a {
    color: #777777;
}
#ct .sd .block {
    background: #000;
}
form,.ts th, tl{
    background: #111111;
}
.tl .ts th, .tl .ts td {
    background: #000; 
}
.fl .bm_c {
    background: #111111;
}
.slideleft,.slideright{
    background: #111111;
}
.pct ,tr{
    background: #111111;
}
.plc .pi {
    background: #171717;
}
#wp .wp {
    background: scroll;
}
.bm_c{
    background: #111111;
}
td.pls, .pls ,.pls .avatar{
    background: none;
}
#ct .frame {
    background: #111111;
}
.pl .quote{
    background: #222
}
}

@-moz-document url-prefix("https://apk.tw/search") {
div{
    background: #777777;
}
.gsc-webResult.gsc-result{  
    background-color: #777777;
}
body {
    background: #111111 none !important;
}
.gsc-control-cse {
    border-color: #111;
    background-color: #111;
}
.gsc-results .gsc-cursor-box .gsc-cursor-page {
    color: #111;
}
a{
    color:#111;
}
}
